  false,\n\t\"url\": null,\n\t\"notes\": \"The polygons in this dataset show mapped
  forest restoration planting polygons. These polygons depict areas where invasive
  plants were removed and native trees and/or shrubs were planted under the purview
  of NYC Parks? Natural Resources Group as part of the MillionTreesNYC initiative
  on property under the jurisdiction of NYC Parks. Spring plantings occur between
  January 1 and June 30, while Fall plantings occur between July 1 and December 31
  of any year. Older restoration polygons were mapped via heads-up digitizing while
  the location of newer polygons have been collected using a high-accuracy GPS device.\",\n\t\"owner_org\":
